import React from "react";
import { Table, Button } from "reactstrap";
import axios from "axios";
import AddProfile from "./AddProfile";
class Profile extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [],
    };
  }

  componentDidMount() {
    this.getUsers();
  }
  getUsers() {
    axios.get(`api/profile`).then((response) => {
      if (response.status === 200) {
        this.setState({
          users: response.data ? response.data : [],
        });
      }
      if (
        response.data.status === "failed" &&
        response.data.success === false
      ) {
        this.setState({
          noDataFound: response.data.message,
        });
      }
    });
  }
  render() {
    const { noDataFound, users } = this.state;
    let usersDetails = [];
    if (users.length) {
      usersDetails = users.map((item, index) => {
        return (
          <tr key={item.id}>
            <td>{index + 1}</td>
            <td>{item.fullname}</td>
            <td>{item.username}</td>
            <td>{item.email}</td>
            <td>{item.phone}</td>
            <td>
              <Button color="success" className="mr-3" size="sm">
                Edit
              </Button>
              <Button color="danger" size="sm">
                Delete
              </Button>
            </td>
          </tr>
        );
      });
    }

    return (
      <div className="App container mt-4">
        <h4 className="font-weight-bold">Quản lý người dùng</h4>
        <AddProfile 
        toggleNewUserModal={this.toggleNewUserModal}
        newUserModal={this.newUserModal}
        onChangeAddUserHandler={this.onChangeAddUserHandler}
        addUser={this.addUser}
        newUserData={this.newUserData}
        />
        <Table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Họ và tên</th>
              <th>Username</th>
              <th>Email</th>
              <th>Điện thoại</th>
              <th>Thao tác</th>
            </tr>
          </thead>
          {users.length === 0 ? (
            <tbody>
              <h3>{noDataFound}</h3>
            </tbody>
          ) : (
            <tbody>{usersDetails}</tbody>
          )}
        </Table>
      </div>
    );
  }
}
export default Profile;
